    /**
     * @covers PropertyService::deletePropertyImages
     */
    public function testDeletePropertyImageNoS3()
    {
        logTestStart(__FUNCTION__);
        $query = "SELECT jos_portal_property_images.property_id
                      FROM jos_portal_property_images jos_portal_property_images
                    GROUP BY jos_portal_property_images.property_id
                    ORDER BY jos_portal_property_images.property_id DESC";
        $properties = WFactory::getSqlService()->select($query);
        $propertyId = $properties[0]["property_id"];
        if ($propertyId == null) {
            $this->markTestIncomplete("Property id not found in images database. skimming testDeletePropertyImage test ");
        } else {
            $result = $this->object->deletePropertyImages($propertyId, false);
            $this->assertTrue($result);
        }

    }

