    /**
     * @covers PropertyService::updatePropertyAgentInformation
     */
    public function testUpdatePropertyAgentInformation()
    {
        logTestStart(__FUNCTION__);
        $query = "SELECT * from jos_portal_sales";
        $agents = WFactory::getSqlService()->select($query);
        $agentId = $agents[0]["id"];
        if ($agentId == null) {
            $this->markTestIncomplete("Agent id not found in sales database. skimming testUpdatePropertyAgentInformation test ");
        } else {
            /**
             * @var $agentDb PortalPortalSalesSql
             */
            $agentDb = WFactory::getSqlService()->getDbClass(__PORTAL_PORTAL_SALES_SQL);
            $agentDb->__id = $agentId;
            $agentDb->loadDataFromDatabase();

            $properties = $this->object->updatePropertyAgentInformation($agentDb);

            $this->assertNotEmpty($properties);
        }
    }


