            array('name' => 'Near Beach'),
            array('name' => 'Restaurant Area'),
            array('name' => 'Business Center'),
            array('name' => 'Village (Moo Baan)'),
            array('name' => 'MRT'),
            array('name' => 'BTS'),
            array('name' => 'Airport Link'),
            array('name' => 'Airport'),
            array('name' => 'Public Transportation'),
            array('name' => 'Railway station'),
            array('name' => 'Shopping Mall'),
            array('name' => 'Bus Station '),
            array('name' => 'Nursery'),
            array('name' => 'Hospital'),
            array('name' => 'Public Park'),
            array('name' => 'Highway'),
            array('name' => 'International School'),
            array('name' => 'Golf Course'),
            array('name' => 'Schools'),
            array('name' => 'University')
        );

        $array = array();
        foreach ($jos_portal_features as $f) {
            $f = $f['name'];
            $original = $f;
            $f = preg_replace("/[^A-Za-z0-9 ]/", '', $f);
            $f = explode(' ', $f);
            $f = array_filter($f);
            $f = implode(' ', $f);
            $f = trim($f);

            $array[] = strtoupper($f) . " = \"$original\"";
        }

        foreach ($array as $a) {
            echo "$a\n";
        }
        echo "---\n";


